import React from "react";
import { Link } from "react-router-dom";

const toLastPage = () => {
    return(
        <button>
            <link to={{pathname: '/nextpath', state: { prevPath: location.pathname }}}
            className="p-2 bg-red-500">
                Back
            </link>
        </button>
    )
}

export default toLastPage();
